import styles from './Home.module.css'

function Home (){
    return(
        <section>
            <h1>Bem-vindo ao <span>Costs</span></h1>
            <p> Comece a gerenciar o seus projetos agora mesmo!</p>
            <a href="/" ></a>
            <img src={pngwing}></img>
        </section>
    )
}

export default Home
